import "./AddDiary.css";
const AddDiary = () => {
  return (
    <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2">
      <form className="modal" >
        <input className="input" placeholder="Name Of Your Diary"></input>
        <select className="select">
            <option value={"food diary"} >Food <Diary></Diary></option>
        </select>
        <input placeholder="Submit" type="submit" className="submit"></input>
      </form>
    </div>
  );
};
export default AddDiary;
